// Get AI output (only one input expected)
const item = $input.item.json;

let aiOutput = {};

try {
  const text = item.output || "";

  // Extract JSON from markdown code blocks or fallback to plain JSON
  const jsonMatch =
    text.match(/```json\s*([\s\S]*?)```/) ||
    text.match(/```\s*([\s\S]*?)```/) ||
    [null, text];

  aiOutput = JSON.parse(jsonMatch[1] || jsonMatch[0]);
} catch (e) {
  // Fallback: parse manually if JSON parsing fails
  const text = item.output || "";
  const finalScoreMatch = text.match(/"final_score"\s*:\s*(\d+)/);
  const consistencyMatch = text.match(/"consistency_score"\s*:\s*(\d+)/);
  const fitMatch = text.match(/"job_fit_score"\s*:\s*(\d+)/);

  aiOutput = {
    final_score: finalScoreMatch ? parseInt(finalScoreMatch[1]) : 0,
    consistency_score: consistencyMatch ? parseInt(consistencyMatch[1]) : 0,
    job_fit_score: fitMatch ? parseInt(fitMatch[1]) : 0,
    educational_qualification: "Parse error",
    job_history_summary: "Parse error",
    skill_set_summary: "Parse error",
    consistency_analysis: "Parse error: " + e.message,
    justification: "Parse error",
  };
}

// Return only AI parsed data
return [
  {
    json: {
      consistency_score: aiOutput.consistency_score || 0,
      job_fit_score: aiOutput.job_fit_score || 0,
      final_score: aiOutput.final_score || 0,
      educational_qualification: aiOutput.educational_qualification || "",
      job_history_summary: aiOutput.job_history_summary || "",
      skill_set_summary: aiOutput.skill_set_summary || "",
      consistency_analysis: aiOutput.consistency_analysis || "",
      justification: aiOutput.justification || "",
    },
  },
];

// Sort all rows by final_score (highest to lowest)
const items = $input.all();

items.sort((a, b) => {
  const scoreA = parseInt(a.json.final_score) || 0;
  const scoreB = parseInt(b.json.final_score) || 0;
  return scoreB - scoreA;
});

return items;

// Get parsed AI results
const item = $input.item.json;

// Convert to desired table-like format
return [
  {
    json: {
      Candidate: item.candidate_name || "Unknown",
      "Answer Quality": item.consistency_score || 0,
      "CV Match": item.job_fit_score || 0,
      "Fit Summary": item.final_score || 0,
      "Final Score": item.final_score || 0,
    },
  },
];

// Combine form data with CV text for comparison
const items = $input.all();

let formData = {};
let cvText = "";

for (const item of items) {
  const data = item.json;

  if (data.Name || data.Email) {
    formData = data;
  }

  if (data.text && typeof data.text === 'string' && data.text.length > 50) {
    cvText = data.text;
  }
}

return {
  json: {
    candidate_name: formData.Name || "",
    email_address: formData.Email || "",
    skills_claimed: formData.Skills || "",
    job_history_claimed: formData['Job History'] || "",
    cv_actual_content: cvText || "[ERROR: No CV text found]",
    timestamp: new Date().toISOString()
  }
};
